            "description": {
                "fi": "<p>Annantalo ja Baltic Circle -teatterifestivaali sekä Taidekoti Kirpilä tekevät marraskuussa yhteisen esityksen, johon kutsutaan mukaan 9-12-vuotiaita lapsia. Osallistuminen on maksutonta.</p><p>Esitystä edeltää työpaja, jossa tutkitaan kämmenten ainutlaatuisia kuvioita ja niissä piileviä kertomuksia kuvataiteen, teatterin, runouden, leikin ja liikkeen keinoin sekä perehdytään kädestä lukemisen taitoon.</p><p><b>TYÖPAJAT:</b><br>pe 8.11. klo 16-19<br>la 9.11. klo 10-16<br>su 10.11. klo 10-16<br>ma 11.11. klo 16-19<br>ti 12.11. klo 16-19</p><p>Esitykset koetaan 15.–17.11. Taidekoti Kirpilässä osana Baltic Circle -teatterifestivaalin ohjelmaa. Aikuisyleisölle suunnatussa esityksessä katsoja toivotetaan tervetulleeksi lasten maailmaan, jossa hän saa henkilökohtaisesti kuulla lapsen tulkinnan elämästään.</p><p>Esityksen ja työpajan ohjaa italialainen taiteilija Francesca Grilli.<br>Työpajoissa ja esityksessä on mukana Annantalon teatteripedagogi Sari Tupamäki.</p><p>Työpajan ja esityksen kielinä toimii suomi ja englanti (mahdollisesti myös italia). Englanninkielen taito ei ole välttämätön, sillä työpajat tulkataan suomeksi.</p><p><b>ESITYKSET (30 min) </b><br>Taidekoti Kirpilässä, Pohjoinen Hesperiankatu 7:<br>to 14.11. klo 17-20 (kenraaliharjoitus vanhemmille)<br>pe 15.11. klo 19<br>la 16.11. klo 13 ja 14 <br>su 17.11. klo 17 ja 18<br>************************************<br><i><b>Sparks<br>Workshop and performance for 9–12-year-olds</b></p><p>Annantalo, the Baltic Circle Theatre Festival and Kirpilä Art Collection will be putting on a joint performance in November, which children between the ages of 9 and 12 are invited to participate in.</p><p>The performance will be preceded by a workshop in which participants will get to examine the unique patterns of the human palm and the stories hidden within through means of visual arts, theatre, poetry, play and movement, and learn about the art of palm reading.</p><p>WORKSHOPS:<br>Fri 8 November at 16–19<br>Sat 9 November at 10–16<br>Sun 10 November at 10–16<br>Mon 11 November at 16–19<br>Tue 12 November at 16–19</p><p>The performances will be experienced on 15–17 November at Kirpilä Art Collection as part of the programme of the Baltic Circle Theatre Festival. Aimed at adults, the performance welcomes the viewer to the world of children, where they get to personally hear a child’s interpretation of their life.</p><p>The performance and workshop are directed by Italian artist Francesca Grilli.<br>Also participating in the workshops and performance is Theatre Pedagogue Sari Tupamäki from Annantalo.</p><p>The workshop and performance languages are Finnish and English (potentially also Italian). English language skills are not required, as the workshops will be interpreted into Finnish.</p><p>PERFORMANCES (30 min) <br>At Kirpilä Art Collection, Pohjoinen Hesperiankatu 7:<br>Thu 14 November at 17–20 (dress rehearsal for parents)<br>Fri 15 November at 19<br>Sat 16 November at 13 and 14 <br>Sun 17 November at 17 and 18 </i></p>"
            },
