            "name": {
                "fi": "Iso kangastus – 10–15 v klo 17.45–19.15"
            },
            "location_extra_info": null,
            "description": {
                "fi": "<p>Liikumme taiteen ja muotoilun rajalla tutkien, kokeillen ja yhdistellen ennakkoluulottomasti huovutusta, kankaan painamista, värjäämistä ja kuvataiteen perusmenetelmiä.</p><p>Työskentelemme usein pitkäjänteisesti ja etsien omaa, itselle luontaista tapaa ilmaista ajatuksia. Lukuvuoden aikana teemme 1–2 pitkää tehtävää ja useita pienempiä menetelmä-, materiaali- ja ideointikokeiluja. Aiempien vuosien isoja tehtäviä ovat olleet muun muassa kello ja käsin sidottu kirja.<br>Tervetuloa mukavaan, keskustelevaan ja yhteistyökykyiseen ryhmäämme.</p><p>Pia Nieminen</p>"
            },
