            "short_description": {
                "fi": "Palaako sisälläsi iso tai pieni kuvauskipinä? Haluaisitko toteuttaa kuvausunelmasi? Mietitkö miten valokuvista saisi vielä vaikuttavampia? Olet ehkä kuvannut paljon kännykuvia, mutta kaipaat vielä apua järjestelmäkameran käytössä."
            },
            "provider_contact_info": null,
            "name": {
                "fi": "Aikaa – 12–18 v klo 17.30-19.45"
            },
            "location_extra_info": null,
            "description": {
                "fi": "<p>Palaako sisälläsi iso tai pieni kuvauskipinä? Haluaisitko toteuttaa kuvausunelmasi? Mietitkö miten valokuvista saisi vielä vaikuttavampia? Olet ehkä kuvannut paljon kännykuvia, mutta kaipaat vielä apua järjestelmäkameran käytössä.</p><p>Tämä on nuorten oma kurssi, jossa keskitytään valokuvaukseen niin itsenäisesti kuvaten kuin studiossa yhdessä työskennellen. Käymme esimerkkien ja kuvatehtävien avulla läpi mitä kaikkea valokuva voi olla. Kurssin tavoitteena on yhteisen työskentelyn kautta pyrkiä kohti omien ideoiden toteutusta ja esittämistä, oppia sekä tekniikkaa että kuvallista ilmaisua.</p><p>Digitaaliseen työskentelyymme kuvaamisen lisäksi kuuluu kuvankäsittelyä (Photoshop) sekä tulostamista. Kurssin aikana on mahdollista tutustua myös pimiötyöskentelyyn sekä erilaisiin tapoihin esittää valokuvia.</p><p>Omia laitteita et tarvitse, vaan tarvittavat välineet löytyvät Annantalosta. Tervetuloa mukaan!</p><p>Elina Julin</p>"
            },
            "info_url": {
                "fi": "http://www.annantalo.fi/fi/tapahtumat/event/F628856ACE775E4358D8783B42E46AD8/Aikaa"
            },
